import React, {useEffect} from 'react';
import axios from 'axios'
import Layout from '../../components/Layout/Layout'
import Header from '../../components/Header/Header'
import FilterMenu from '../../components/FilterMenu/FilterMenu'
import BottomBar from '../../components/BottomBar/BottomBar'
import ProgramRow from '../../components/ProgramRow/ProgramRow'

import {GET_COUNT} from '../../graphQL/queries'

import { ProgramContainer, ResultsHeader} from './HomePage.styles'

type HomePageProps = {
  getInitialProps: Function
}

interface HomePageInterface<HomePageProps> extends React.FC<HomePageProps> {
  getInitialProps?: (ctx: any) => Promise<any>
}

const HomePage: HomePageInterface<HomePageProps> = () => {


  return (
    <Layout>
    <Header />
    <FilterMenu />
    <ProgramContainer>
        <ResultsHeader>300 programs found for engineering!</ResultsHeader>
        <ProgramRow />
        <ProgramRow />
        <ProgramRow />
        <ProgramRow />
        <ProgramRow />
        <ProgramRow />
        <ProgramRow />
        <ProgramRow />
        <ProgramRow />
        <ProgramRow />
    </ProgramContainer>
    <BottomBar/>
  </Layout>
  )
}

const getData = () => new Promise(async (res, rej)=> {
  const data = await axios({
    url: "http://localhost:4000/gql",
    method: "post",
    data: {
      query: GET_COUNT
    }
  })
  res(data)
})

HomePage.getInitialProps = async(ctx) => {

  let resp = await getData()
  console.log(resp.data.data)
  return {}
}


export default HomePage;
